  false,\n\t\"url\": null,\n\t\"notes\": \"Baseline information on the abundance,
  distribution and species diversity of fishes and general water quality parameters
  at the Prime Hook National Wildlife Refuge was collected during the week of June
  6, 1994. Data analyzed from refuge waters indicate that the area supports a sport
  fish population whose quality varies among the various creeks and impoundments within
  the refuge.  This report outlines the numbers, weight and length of all fish surveyed
  in each of the seven bodies of water that were the focus of this study.\",\n\t\"license_title\":
